import React from 'react';
import styled from 'styled-components';

const SlideOne = ({className}) => {
  return (
    <div className={className}>
      <h3>SLIDE ONE</h3>
    </div>
  );
}

const SOne = styled(SlideOne)`
  background-color: black;
  color: white;
  width: 100%;
  height: 80vh;
`;

export default SOne;
